import React from 'react';

const receipt1 = {
    person: "Karolin",
    order: {
      main: "Burrito",
      protein: "Organic Tofu",
      rice: "Purple Rice",
      sauce: "Green Crack",
      toppings: ["Baby Bok Choy", "Cucumber Kimchi"],
      drink: "Korchata",
      cost: 22,
    }
};

const Receipt = ({person, order}) => {

    return (
        <div>
            {receipt1.map((person, order)=> 
                <h1>
                {person}
                {order.main}
                {order.protein}
                {order.rice}
                {order.main}
                {order.sauce}
                {order.toppings}
                {order.main}
                </h1> )}
        </div>
    );
};

export default Receipt;
